import React from "react";
import { Form } from "react-router-dom";

const Forms = () => {



return (
    <Form>
    <div>
    <label></label>
    <input>EMAIL</input>
    </div>
    <div>
    <label></label>
    <input>PASSWORD</input>
    </div>
    <div>
    <button>SUBMIT</button>
    </div>
</Form>
);
};

export default Forms;
